{ users.users.${sshUser}.openssh.authorizedKeys.keyFiles = [ ../secrets/path/to/key.pub ];
} And the private key to your user: { ... }:
{ home-manager.users.${sshUser}.programs.ssh = { enable = true; matchBlocks = { ${host} = { host = hostName; identityFile = ../secrets/path/to/key; extraOptions = { AddKeysToAgent = "yes"; }; }; }; }
} And run the deployment: deploy "flk#hostName" --hostname host.example.com Note: Your user will need passwordless sudo access
